import React, { useState } from 'react'

import { Link } from "react-router-dom"

const CreateStudent = () => {

  const [id, setId] = useState("");
  const [name, setName] = useState("");
  const [place, setPlace] = useState("");
  const [phone, setPhone] = useState("");
  const handleSubmit=(e)=>{
    e.preventDefault();
    // Add new student to the database here
    console.log({id, name, place, phone});
    fetch("http://localhost:3400/students").then((res)=>console.log(res)).catch((err)=>console.log(err)
    )
  }

  return (
    <div className='container'>
      <h2>Yeni Tələbə Əlavə et</h2>
      <form onSubmit={handleSubmit}>

        <label htmlFor="id">ID:</label>
        <input type="text" id="id" name="id" value={id} required onChange={e=>setId(e.target.value)}/>
        
        <label htmlFor="name">Adı:</label>
        <input type="text" id="name" name="name" required value={name} onChange={e=>setName(e.target.value)}/>

        <label htmlFor="place">Ünvan:</label>
        <input type="text" id="place" name="place" required value={place} onChange={e=>setPlace(e.target.value)}/>

        <label htmlFor="phone">Nömrə:</label>
        <input type="text" id="phone" name="phone" required value={phone} onChange={e=>setPhone(e.target.value)}/>


        <div className='form-buttons'>
          <button className='btn btn-save'>Yadda saxla</button>
          <Link to="/" className='btn btn-back'>Back</Link>
        </div>
      </form>
    </div>
  )
}

export default CreateStudent
